/**
 * print error message with new line
 * @param {any} message an argument of any type to print with newline
 * @param {any[]} optionalParams other arguments of any type
 */
export function error(message?: any, ...optionalParams: any[]): void;

/**
 * print log message with new line
 * @param {any} message an argument of any type to print with newline
 * @param {any[]} optionalParams other arguments of any type
 */
export function log(message?: any, ...optionalParams: any[]): void;

/**
 * print warning message with new line
 * @param {any} message an argument of any type to print with newline
 * @param {any[]} optionalParams other arguments of any type
 */
export function warn(message?: any, ...optionalParams: any[]): void;